// components/NavBar.js
import React from "react";
import { NavLink } from "react-router-dom";

const NavBar = () => {
  return (
    <div style={{ display: "flex", flexDirection: "column", padding: "20px" }}>
      <NavLink to="/" exact style={{ margin: "5px" }}>
        Home
      </NavLink>
      <NavLink to="/not-started" style={{ margin: "5px" }}>
        Not Started
      </NavLink>
      <NavLink to="/in-progress" style={{ margin: "5px" }}>
        In Progress
      </NavLink>
      <NavLink to="/completed" style={{ margin: "5px" }}>
        Completed
      </NavLink>
      <NavLink to="/my-tasks" style={{ margin: "5px" }}>
        My Tasks
      </NavLink>
      <button style={{ marginTop: "20px" }}>Log In/Out</button>
    </div>
  );
};

export default NavBar;
